INSERT INTO `status_table` VALUES (1,0,'2018-02-04 16:34:06','This is my status','Ram Kumar','ram'),(2,0,'2018-02-04 16:34:27','This second status','Ram Kumar','ram'),(3,0,'2018-02-04 17:14:07','This Status Number second','Ram Kumar','ram'),(4,0,'2018-02-04 18:20:47','In this other case if you delete the Author it will delete all the books pf that author in cascade.\r\n\r\nMany-to-one/one-to-one: saves and deletes cascade from the owner to the dependant (the class with the belongsTo).\r\n\r\nOne-to-many: saves always cascade from the one side to the many side, but if the many side has belongsTo, then deletes also cascade in that direction.\r\n\r\nMany-to-many: only saves cascade from the \"owner\" to the \"dependant\", not deletes.','Lalit Kumar','lalitk'),(5,0,'2018-02-04 18:21:35','In this other case if you delete the Author it will delete all the books pf that author in cascade.\r\n\r\nMany-to-one/one-to-one: saves and deletes cascade from the owner to the dependant (the class with the belongsTo).\r\n\r\nOne-to-many: saves always cascade from the one side to the many side, but if the many side has belongsTo, then deletes also cascade in that direction.\r\n\r\nMany-to-many: only saves cascade from the \"owner\" to the \"dependant\", not deletes.','Lalit Kumar','lalitk'),(6,0,'2018-02-05 08:24:21','Billionaire Elon Musk last year built the worldâ€™s biggest lithium-ion battery system to support South Australiaâ€™s blackout-plagued power grid. Musk made a bet on Twitter that Tesla could install a 100-megawatt storage facility in the Australian outback within 100 days or it would be free -- and made good on his pledge to be finished by summer.\r\n\r\nAustralia, one of the worldâ€™s biggest users of rooftop solar panels, likely added the most new capacity on record last year as electricity users sought to ease escalating power bills. While subsidies and generous feed-in tariffs helped boost growth earlier this decade, last yearâ€™s gains were driven by users seeking t